import React from 'react';

import Grid from '../components/GameGrid/gameGrid';
import GridExemple from '../components/ExempleGrid/gameGrid'
import Options from '../components/GameOptions/gameOptions'

const Main = () => {
    return(
        <div className='SetupPage'>
            <Options/>
            <GridExemple/>
        </div>
    )
}

export default Main;
